 сравнительной степени происходит измением суффикса. Т.е вот так: earlier - раньше','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1332,127,'loudly','громче','Кстати, это тоже исключение, тут образование сравнительной степени происходит измением суффикса. Т.е вот так: louder - раньше','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1333,127,'badly','плохо','Это исключение:\n\n\nОбычная форма: badly\nСравнительная форма: worse - хуже\nПревосходная: worst - худший','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1334,127,'well','хорошо','Это наречие, что очень удивило меня, ибо я всегда задовался вопросом, почему его пишут в конце, а оказывается что это наречие, ммм.\n\nОбычная форма: well\nСравнительная форма: better - лучше\nПревосходная: best - самый лучший','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1335,127,'little','мало','Это тоже наречие.\n\n\nОбычная форма: little\nСравнительная форма: less\nПревосходная: least','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1336,127,'much','много','Это тоже наречие.\n\n\nОбычная форма: much\nСравнительная форма: more\nПревосходная: most','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1337,127,'quickly','быстро (о движениях, действиях)','','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1338,127,'slowly','медленно','','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1339,127,'carefully','осторожно, внимательно','','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1340,127,'hard','усердно, много','Прилагательное hard значит «трудный» (например, о работе) или «жесткий» (о материале). \n\nНаречие hard значит «изо всех сил», «прилагая большие усилия».\n\nПримеры с прилагательным hard:\nThe snow is hard. — Снег жесткий.\nThis game is hard. — Эта игра трудная.\n\nПримеры с наречием hard:\nYou work too hard, you need some rest. — Ты работаешь слишком много (прилагая много усилий), тебе нужен отдых.\nI will study hard. — Я буду учиться добросовестно (изо всех сил, старательно и т. д.).','2022-08-25 17:05:34','2022-08-25 17:05:34'),(1341,127,'long